{"name": "Rockville HELP", "alternate_name": "", "description": "Clients should call **301-564-0800** and leave a message. Our Officer of the Day will call them back. They should make sure they unblock unknown numbers and monitor their calls - our volunteers use their own phones, so the call back might come from a private or out-of-area number. 

If a client does not have a reliable phone or is not able to take phone calls, they can email us here (**rockvillemdhelp@gmail.com**), but the response time is likely to be longer because we don't have people continuously monitoring the email as we do with the phone line.
